function TimestampZero(TZ) {
	var timeStamp = TZ;
	var d = new Date(timeStamp * 1000);
	var a = d.getFullYear();
	var j = d.getDate();
	var m = d.getMonth() + 1;
	var tempZero;
	var tempDate = a + " " + m + " " + j + " 00:00:00";
	tempZero = Date.parse(tempDate);
	return tempZero / 1000;
}
function TimestampToDate(TSS) {
	let jours = new Array(
		"dimanche",
		"lundi",
		"mardi",
		"mercredi",
		"jeudi",
		"vendredi",
		"samedi"
	);
	var mois = new Array(
		"janvier",
		"février",
		"mars",
		"avril",
		"mai",
		"juin",
		"juillet",
		"août",
		"septembre",
		"octobre",
		"novembre",
		"décembre"
	);
	var timeStamp = TSS;
	var d = new Date(timeStamp * 1000);
	var a = d.getFullYear();
	var j = d.getDate();
	var m = d.getMonth() + 1;
	var h = d.getHours();
	var min = d.getMinutes();
	var sec = d.getSeconds();
	return jours[d.getDay()] + " " + j + " " + mois[d.getMonth()] + " " + a;
}
